    data: |
      SELECT DISTINCT - ( 82 ) AS col0, col2 + + col2 * + - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q9060.out
    data: |
      -82	-1248
      -82	-236
      -82	-3128
